abstract contract ReentrancyGuard {
    uint256 private constant _NOT_ENTERED = 1;
    uint256 private constant _ENTERED = 2;

    uint256 private _status;

    constructor() {
        _status = _NOT_ENTERED;
    }

    modifier nonReentrant() {
        require(_status != _ENTERED, "ReentrancyGuard: reentrant call");
        _status = _ENTERED;
        _;
        _status = _NOT_ENTERED;
    }
}

contract RevShareStaking is ReentrancyGuard, DividendTracker {
    using SafeMath for uint256;
    using SafeMathUint for uint256;
    using SafeMathInt for int256;

    IERC20 public immutable token;
    IDexRouter public immutable dexRouter;

    mapping(address => uint256) public holderUnlockTime;
    uint256 public lockDuration;

    address public rewardsWallet;

    uint8 public stakeTax = 10;
    uint8 public claimTax = 10;
    uint8 public compoundTax = 5;

    IUniswapV2Router02 public uniswapV2Router;

    event Deposit(address indexed user, uint256 amount);
    event Withdraw(address indexed user, uint256 amount);

    constructor(address _token, uint256 _lockTimeInDays) {
        require(_token != address(0), "token address cannot be 0 address");
        token = IERC20(_token);

        lockDuration = _lockTimeInDays * 1 days;

        address _v2Router;

        // @dev assumes WETH pair
        if (block.chainid == 1) {
            _v2Router = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D;
        } else if (block.chainid == 5) {
            _v2Router = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D;
        } else {
            revert("Chain not configured");
        }

        dexRouter = IDexRouter(_v2Router);
        rewardsWallet = msg.sender;
    }

    // Stake primary tokens
    function deposit(uint256 _amount) external nonReentrant {
        require(_amount > 0, "Zero Amount");

        if (holderUnlockTime[msg.sender] == 0) {
            holderUnlockTime[msg.sender] = block.timestamp + lockDuration;
        }
        uint256 userAmount = holderBalance[msg.sender];

        uint256 amountTransferred = 0;

        uint256 taxAmount = (_amount * stakeTax) / 100;

        uint256 initialBalance = token.balanceOf(address(this));
        token.transferFrom(address(msg.sender), address(this), _amount);
        _swapTokensForEth(taxAmount);
        amountTransferred = token.balanceOf(address(this)) - initialBalance;

        setBalance(payable(msg.sender), userAmount + amountTransferred);

        emit Deposit(msg.sender, _amount);
    }

    // Withdraw primary tokens

    function withdraw(uint256 _amount) external nonReentrant {
        require(_amount > 0, "Zero Amount");
        uint256 userAmount = holderBalance[msg.sender];
        require(_amount <= userAmount, "Not enough tokens");
        require(
            holderUnlockTime[msg.sender] <= block.timestamp,
            "May not withdraw early"
        );

        token.transfer(address(msg.sender), _amount);

        setBalance(payable(msg.sender), userAmount - _amount);

        if (userAmount > 0) {
            holderUnlockTime[msg.sender] = block.timestamp + lockDuration;
        } else {
            holderUnlockTime[msg.sender] = 0;
        }

        emit Withdraw(msg.sender, _amount);
    }

    function withdrawAll() public nonReentrant {
        uint256 userAmount = holderBalance[msg.sender];
        require(userAmount > 0, "Not a holder");
        require(
            holderUnlockTime[msg.sender] <= block.timestamp,
            "May not withdraw early"
        );

        token.transfer(address(msg.sender), userAmount);

        setBalance(payable(msg.sender), 0);
        holderUnlockTime[msg.sender] = 0;

        emit Withdraw(msg.sender, userAmount);
    }

    function claim() external nonReentrant {
        uint256 amount = 0;

        uint256 _withdrawableDividend = withdrawableDividendOf(
            payable(msg.sender)
        );
        if (_withdrawableDividend > 0) {
            withdrawnDividends[payable(msg.sender)] = withdrawnDividends[
                payable(msg.sender)
            ].add(_withdrawableDividend);

            emit DividendWithdrawn(payable(msg.sender), _withdrawableDividend);

            uint256 taxAmount = (_withdrawableDividend * stakeTax) / 100;

            (bool userTransferSuccess, ) = payable(msg.sender).call{
                value: _withdrawableDividend - taxAmount
            }("");

            (bool taxTransferSuccess, ) = payable(rewardsWallet).call{
                value: taxAmount
            }("");

            if (!userTransferSuccess) {
                withdrawnDividends[payable(msg.sender)] = withdrawnDividends[
                    payable(msg.sender)
                ].sub(_withdrawableDividend);
                amount = 0;
            }

            amount = _withdrawableDividend;
        }

        if (amount > 0) {
            emit Claim(payable(msg.sender), amount, false);
        }
    }

    function compound(uint256 minOutput) external nonReentrant {
        uint256 userAmount = holderBalance[msg.sender];
        uint256 amountEthForCompound = _withdrawDividendOfUserForCompound(
            payable(msg.sender)
        );
        if (amountEthForCompound > 0) {
            uint256 initialBalance = token.balanceOf(address(this));
            buyBackTokens(amountEthForCompound, minOutput);
            uint256 amountTransferred = token.balanceOf(address(this)) -
                initialBalance;
            setBalance(payable(msg.sender), userAmount + amountTransferred);
        } else {
            revert("No rewards");
        }
    }

    function _withdrawDividendOfUserForCompound(
        address payable user
    ) internal returns (uint256 _withdrawableDividend) {
        _withdrawableDividend = withdrawableDividendOf(user);
        if (_withdrawableDividend > 0) {
            withdrawnDividends[user] =
                withdrawnDividends[user] +
                _withdrawableDividend;
            emit DividendWithdrawn(user, _withdrawableDividend);
        }
    }

    function buyBackTokens(uint256 ethAmountInWei, uint256 minOut) internal {
        // generate the uniswap pair path of weth -> eth
        address[] memory path = new address[](2);
        path[0] = dexRouter.WETH();
        path[1] = address(token);

        // make the swap
        dexRouter.swapExactETHForTokensSupportingFeeOnTransferTokens{
            value: ethAmountInWei
        }(minOut, path, address(this), block.timestamp);
    }

    // helper views

    function getExpectedCompoundOutputByEthAmount(
        uint256 rewardAmount
    ) external view returns (uint256) {
        address[] memory path = new address[](2);
        path[0] = dexRouter.WETH();
        path[1] = address(token);
        uint256[] memory amounts = dexRouter.getAmountsOut(rewardAmount, path);
        return amounts[1];
    }

    function getExpectedCompoundOutputByWallet(
        address wallet
    ) external view returns (uint256) {
        uint256 rewardAmount = withdrawableDividendOf(wallet);
        address[] memory path = new address[](2);
        path[0] = dexRouter.WETH();
        path[1] = address(token);
        uint256[] memory amounts = dexRouter.getAmountsOut(rewardAmount, path);
        return amounts[1];
    }

    /// @notice Swaps the token amount to ETH using the Uniswap V2 router.
    function _swapTokensForEth(uint256 tokenAmount_) private {
        address[] memory path = new address[](2);
        path[0] = address(token);
        path[1] = uniswapV2Router.WETH();

        require(
            tokenAmount_ > 0,
            "Staking: Token amount less then 0 for token swap"
        );

        token.approve(address(uniswapV2Router), tokenAmount_);

        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount_,
            0,
            path,
            rewardsWallet,
            block.timestamp
        );
    }
}
